    data: |
      SELECT DISTINCT - CAST ( col1 AS INTEGER ) * col0 - + col1 FROM tab2 (FORMAT parquet) cor0 WHERE NOT - 58 NOT BETWEEN col0 AND 55 * - col2 + CAST ( ( - col2 ) AS INTEGER );
  - name: tab2

outputs:
  - name: q10862.out
    data: |
